import React from 'react';

const styles = {
    image: {
        width: '20%',
        minWidth: '200px',
        height: '20%',
        minHeight: '200px',
        borderRadius: '25%',
        borderColor: 'black',
        borderWidth: '5px',
        marginLeft: '20%',
    },
    container: {
        textAlign: 'center',
        marginTop: '20%',
        marginLeft: '10%',
        display: 'inline-block',
        width: '40%',
        border: '0.1em solid black',
        borderWidth: '1px',
    }
}

const About = () => {

    return (

        <>
            <div className='portfoliocontainer'>
                <img src='https://avatars0.githubusercontent.com/u/54956992?s=460&v=4' alt='picture' style={styles.image} />
                <div style={styles.container}>
                <p>I am a Front-End Developer...</p>
                <p>I enjoy creating applications with good design and value mobile responsiveness.</p>

                </div>
            </div>
        </>
    )
}
export default About
